import React from "react";
import "./home.css";
import { TypeAnimation } from "react-type-animation";
import { Link } from "react-router-dom";
import Nav from "./nav";

function Home() {
  const ExampleComponent = () => {
    return (
      <TypeAnimation
        sequence={[
          "Software x Business",
          2000,
          "Software x Videography",
          2000,
          "Software x Marketing",
          2000,
          "Software x Hardware",
          2000,
        ]}
        wrapper="span"
        speed={50}
        style={{ fontSize: "3vw", display: "inline-block" }}
        repeat={Infinity}
      />
    );
  };

  return (
    <div>
      <div id="home" className="coverContainer">
        <div className="cover">
          <div className="nameContainer">
            <h1 className="name">
              <p className="hi">hi, i am justin.</p>
              <ExampleComponent></ExampleComponent>
            </h1>
          </div>
        </div>
      </div>
      <div id="about-me-section" className="idContainer">
        <div className="photo">
          <div className="photoContainer">
            <img src="icon.png"></img>
          </div>
        </div>
        <div className="justin">
          <div className="socialMedia">
            <h1>hello</h1>
          </div>
          <div className="textContainer">
            <h1>Welcome to my little world!</h1>
            <p>hello, I am Justin</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
